<?php

namespace App\Tests\src\Books\Domain\ValueObject;

use App\Books\Domain\ValueObject\BookImage;

class BookImageMother
{
    public static function create(?string $value = null): BookImage
    {
        return new BookImage($value ?? self::base64Image());
    }



    private static function base64Image(): string
    {
        return "data:image/jpeg;base64,";
    }
}
